vidio  medium-high yang realistis dan alami yang diambil setinggi mata menggunakan iPhone terbaru, dengan pencahayaan alami yang hangat dan kualitas HD yang tajam, mengabadikan suasana kedai kopi pinggir jalan khas Indonesia di malam musim panas yang cerah.
Latar belakang menunjukkan lalu lintas yang lewat, terdiri dari sepeda motor dan mobil, diterangi oleh lampu jalan dan penerangan dari warung makan terdekat. Pencahayaan yang digunakan alami, berasal dari lampu jalan dan warung di sekitarnya.
Tidak ada filter atau perangkat tambahan yang digunakan. Bayangan, tekstur kulit, dan warna tampak realistis dan tidak tersentuh, menghasilkan vidio  yang sangat alami yang tidak menyerupai gambar yang dihasilkan Al.
